import React, { Component } from 'react';
import { Icon, Label } from 'semantic-ui-react'


class AuthContainer extends Component {

  render() {

    return (
      <div>
      {localStorage.token ?
          <Label image>
            <img src={this.props.user.picture}/>
            Welcome {this.props.user.username}!
          </Label> : null }
      </div>
    );
  }

}



